(function (c) {
    config.init();
    TabBlock.init();
    var a = Fx.getUrlParam("tab");
    if (!a) {
        a = 0
    }
    TabBlock.switchTab(c(".tabBlock-tab").eq(a));
    var b = {
        parameters: {
            customerFamilyId: Fx.getUrlParam("customerFamilyId"),
            hospitalId: "1000",
            dateTime: Fx.getUrlParam("date"),
            clinicCode: Fx.getUrlParam("clinicCode")
        },
        addEvent: {
            doing: function () {
                c(".lists li a").on("tap",
                function () {
                    icoNav.popWinLayer(c(this).attr("vhref"))
                });
                icoNav.ton(".lists li a")
            }
        },
        doing: function () {
            if (b.parameters.customerFamilyId && b.parameters.dateTime) {
                hzAPI.options.templateHtml[0] = c("#getDate").html();
                c("#getDate").html(hzAPI.setTemplate(hzAPI.options.templateHtml[0], [b.parameters]));
                c("#getDate").show();
                b.detail.doing()
            }
        },
        detail: {
            doing: function () {
                hzAPI.getData("http://ywtwx.dept.nfyy.com/ywtapi/?c=ReqHis&a=labTestList", b.parameters, "#lab ul", 2, true, null, false, "该次就诊没检验项目", b.addEvent);
                hzAPI.getData("http://ywtwx.dept.nfyy.com/ywtapi/?c=ReqHis&a=examList", b.parameters, "#exam ul", 3, true, null, false, "该次就诊没检查项目", b.addEvent)
            }
        }
    };
    b.doing()
})(Zepto);